import React, { useState } from "react";
import { Box, TextField, MenuItem, Button, Typography } from "@mui/material";

const CarFilterSidebar = ({ onFilter }) => {
  const [filters, setFilters] = useState({
    brand: "",
    model: "",
    fuel: "",
    km: "",
    kmDirection: "less",
    price: "",
    priceDirection: "less",
  });

  const handleChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const applyFilters = () => {
    onFilter(filters);
  };

  return (
    <Box sx={{ width: 250, p: 2, borderRight: "1px solid #ccc" }}>
      <Typography variant="h6" gutterBottom>
        Filtrele
      </Typography>

      <TextField
        label="Marka"
        name="brand"
        value={filters.brand}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Model"
        name="model"
        value={filters.model}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Yakıt Tipi"
        name="fuel"
        value={filters.fuel}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Kilometre"
        name="km"
        type="number"
        value={filters.km}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        select
        label="Km Yönü"
        name="kmDirection"
        value={filters.kmDirection}
        onChange={handleChange}
        fullWidth
        margin="normal"
      >
        <MenuItem value="less">Daha az</MenuItem>
        <MenuItem value="more">Daha fazla</MenuItem>
      </TextField>
      <TextField
        label="Fiyat"
        name="price"
        type="number"
        value={filters.price}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        select
        label="Fiyat Yönü"
        name="priceDirection"
        value={filters.priceDirection}
        onChange={handleChange}
        fullWidth
        margin="normal"
      >
        <MenuItem value="less">Daha az</MenuItem>
        <MenuItem value="more">Daha fazla</MenuItem>
      </TextField>

      <Button
        variant="contained"
        fullWidth
        sx={{ mt: 2 }}
        onClick={applyFilters}
      >
        Filtrele
      </Button>
    </Box>
  );
};

export default CarFilterSidebar;
